const DeletePopup = ({ key }) => {
  return (
    <div className="modal">
      <div className="modal_content">
        <span className="close">&times;</span>
        <form>
          <h3>Wanna Delete !</h3>
          <label>'Test Key'</label>
          <br />
          <input type="submit" value="Yes" />
          <input type="submit" value="No" />
        </form>
      </div>
    </div>
  );
};

export default DeletePopup;
